SELECT "DbT5503"."shinsakaiKaisaiNo", "DbT5503"."shinsakaiIinCode", "DbT5594"."shinsakaiIinShimei", "DbT5503"."kaigoninteiShinsakaiGichoKubunCode", "DbT5503"."shussekiFlag", "DbT5594"."shinsakaiIinShikakuCode", "DbT5503"."shussekiTime", "DbT5503"."taisekiTime", "DbT5503"."existChikokuFlag", "DbT5503"."existSotaiFlag" FROM rgdb."DbT5503ShinsakaiWariateIinJoho" AS "DbT5503" INNER JOIN rgdb."DbT5594ShinsakaiIinJoho" AS "DbT5594" ON "DbT5503"."shinsakaiIinCode"= "DbT5594"."shinsakaiIinCode"
"DbT5503"."shinsakaiKaisaiNo" = #{kaisaiBangou}
ORDER BY "DbT5503"."shinsakaiIinCode" ASC

